import React, {Component} from 'react'
import './users.css';


class Users extends Component {  
    constructor(){
        super();
        this.state = {
          users: []
        }
    }

    componentDidMount(){
        fetch('http://localhost:3000/users')
        .then(res => res.json())
        .then(users => this.setState({users}))

    }

    render (){
        return (
            <div>
            <h2>Users</h2>
            <ul>
                {this.state.users.map(users =>
                    <li>{users.first_name}</li>    
                )}
            </ul>
            </div>
        );
    }  
}

export default Users;
